import { Model } from '..';
const model = Model.withLogicalClock(1234);
console.log(model.view());
console.log(model + '');
model.api.root({
    counter: 0,
    text: 'Hello',
});
console.log(model.view());
console.log(model + '');
model.api.obj([]).set({
    counter: 25,
});
model.api.str(['text']).ins(5, ' world!');
console.log(model.view());
console.log(model + '');
const blob = model.toBinary();
console.log(blob);
const fork = Model.fromBinary(blob);
console.log(fork + '');
const patch = model.api.flush();
console.log(patch + '');
const patchBlob = patch.toBinary();
console.log(patchBlob);
